import React,{Component} from 'react';
import './Main.css';
import Header from './Header/Header';
import Body from './Body/Body';
import Footer from './Footer/Footer';

import Out from './Out/Out';
class Main extends React.Component{
  scrollToTop() {
    window.scrollTo({
      top: 0,
      behavior: "smooth"
    });
  }
  render(){
      return(
        <div>
            <Header></Header>
            <Body></Body>
            <Footer></Footer>
            <a  className="return-to-top" onClick={this.sc} data-toggle="tooltip"><i class="icon-chevron-up"></i></a>
            <a  className="return-to-bottom" data-toggle="tooltip"><i class="icon-chevron-down"></i></a>
        </div>
      )
  }
}
export default Main;
